import React from "react";
import Navbar from "./Navbar";

const About = () => {
  return (
    <div>
      <Navbar />
      <h1>About Us</h1>
      <p>Velava Super Stores has been serving customers with quality products for over a decade.</p>
    </div>
  );
};

export default About;
